variables.description:
/** Error: Expression returns Object, expected Number **/
{{ ["1920","1366"].includes($$.mode)
  ? parseInt($$.name.match(/\d+$/)[0])
  : 0
}}

/** Error: Expression returns Object, expected Color {r: number, g: number, b: number, a?: number}, number between 0 and 1, a is optional **/
{{
  $[
    "Color Library/"
    + (
        $$.collection.name.includes("Dual") ? "Dual/" :
        $$.collection.name.includes("Single") ? "Single/" :
        $$.collection.name.includes("Alpha") ? "Dual/" :
        "Dual/"
      )
    + $base/primary[$$.mode]
    + (
        $$.collection.name.includes("Alpha") ? " Alpha/" : "/"
      )
    + $$.name.match(/\d+/)[0]
  ]
}}
